  return (
    <div>
      <React.Fragment>
        <CssBaseline />
        <Header />
        <div
          style={{
            height: "10%",
            marginTop: "5%",
          }}
        >
          <Grid
            container
            direction="row"
            justifyContent="space-between"
            alignItems="flex-start"
            
          >
            <Grid xs={3}>
              <Grid
                container
                spacing={10}
                direction="column"
                justifyContent="space-between"
                alignItems="center" 
              >
                <Grid item >
                  <Category />
                </Grid>
                <hr />
                <Grid item >
                  <Files />
                </Grid>
              </Grid>
            </Grid>

            <Grid xs={9}>
              <Grid
                container
                direction="column"
                justifyContent="flex-end"
                alignItems="center"
              >
                <Grid>
                  <Slides />;
                </Grid>
                <Grid>
                  <Images />
                </Grid>
              </Grid>
            </Grid>
          </Grid>
        </div>
      </React.Fragment>
    </div>
  );
};

export default App;
